import React from 'react';
import {  Link } from "react-router-dom";
import Search from './searchBook' ;
const navbar= (props) =>{
  return (
  <div>
    <div className={classes.header}>Movie Recommendator</div>
    <li>
      <Link to="/">home</Link>
    </li>
    <li>
      <h3>{props.title}</h3>
    </li>
    <li>
      <Search/>
    </li>
  </div>
  );
}
export default navbar;
